import React from 'react';
import { Link } from 'react-router-dom';

import './Nav.css';

const Nav = () => {
  return (
    <div>
      <nav>
        <ul class="horizontal-list">
          <li class="navLink"><a class="navLink" href="https://azure.microsoft.com/en-us"><img class="logo" src="https://upload.wikimedia.org/wikipedia/commons/a/a8/Microsoft_Azure_Logo.svg"></img></a></li>
          <li><Link className="navLink" to="/">Home</Link></li>
          <li><Link className="navLink" to="/explore">Explore</Link></li>
          <li><Link className="navLink" to="/shifting">Shifting</Link></li>
          <li><Link className="navLink" to="/documentation">Documentation</Link></li>
        </ul>
     	</nav>
      <hr />
    </div>
  );
};

export default Nav;
